import { useAuth } from "../context/authContext";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCircleStop } from "@fortawesome/free-solid-svg-icons";
import r from "../img/user.png";
import re from "../img/repositories.png"
import ref from "../img/reports.png"
import styled from 'styled-components';
import { Overlay } from "react-bootstrap";

export function Home() {
  const { logout, user } = useAuth();

  console.log(user);
  const handleLogout = async () => {
    try {
      await logout();
    } catch (error) {
      console.error(error.message);
    }
  };

  return (
    <div className="text-black">
      <div>
        <Overlay>
          <ContenedorModal>
            <EncabezadoModal>
              <h3>Titulo</h3>
            </EncabezadoModal>
            <BotonCerrar>X</BotonCerrar>
          </ContenedorModal>
        </Overlay>
		</div>
      <Navbar bg="light" variant="light">
        <Container>
          <Nav className="me-auto">
          <img src={r} >
      </img>
            <h5>Welcome : 
            <p>
            </p>
            <p>
            {user.displayName || user.email}
            </p>
            <p>
            <FontAwesomeIcon icon={faCircleStop}></FontAwesomeIcon> Active</p></h5>
            <div className="">
              <Button
                variant="light"
                className="bg-slate-200 hover:bg-slate-300 rounded py-2 px-4 text-black"
                onClick={handleLogout}
              >
                Logout
              </Button>
              {""}
            </div>
          </Nav>
        </Container>
      </Navbar>
      <p>
      </p>
      <form className=" bg-slate-100  rounded px-4 pt-3 pb-4 mb-2 shadow rounded border-2">
        <div className="mb-4">
          <label className="block text-black-700 text-sm font-bold mb-2">
            <center>
              <h4>Menu</h4>
            </center>
          </label>
          <p></p>
          <div className="mb-4">
          </div>
          <div className="flex items-center justify-between">
            <img src={re}>
            
            </img>
            <label>
              Repositories 
            </label>
            <p>
            <Link to="/repositories" className="text-blue-700 hover:text-blue-900">
              Get In
            </Link>
            </p>
          </div>
          <p>

          </p>
          <div className="flex items-center justify-between">
          <img src={ref}>
            </img>
            <label>
              Reports
            </label>
            <button
              className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              type="submit"
            >
              <Link to=""></Link>
              Get in
            </button>
          </div>
          <p>
          </p>
        </div>
      </form>
    </div>
  );
}

const ContenedorBotones = styled.div`
	padding: 40px;
	display: flex;
	flex-wrap: wrap;
	justify-content: center;
	gap: 20px;
`;

const Boton = styled.button`
	display: block;
	padding: 10px 30px;
	border-radius: 100px;
	color: #fff;
	border: none;
	background: #1766DC;
	cursor: pointer;
	font-family: 'Roboto', sans-serif;
	font-weight: 500;
	transition: .3s ease all;

	&:hover {
		background: #0066FF;
	}
`;

const Contenido = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;

	h1 {
		font-size: 42px;
		font-weight: 700;
		margin-bottom: 10px;
	}

	p {
		font-size: 18px;
		margin-bottom: 20px;
	}

	img {
		width: 100%;
		vertical-align: top;
		border-radius: 3px;
	}
`;
